$DATA = OSC::decode($DATA);

foreach ($DATA['option_product']['option_sets'][0]['options'] as $option_idx => $option) {
    if ($option['type'] !== 'swatch') {
        continue;
    }

    $dirname = $option['public_name'];

    if (!file_exists(OSC_VAR_PATH . '/crawler/' . $dirname)) {
        OSC::makeDir(OSC_VAR_PATH . '/crawler/' . $dirname);
    } else {
        echo "Error [" . $option_idx . "]: duplicate \n";
        continue;
    }

    foreach ($option['options_values'] as $value_idx => $value) {
        if (!isset($value['swatch'])) {
            echo "Cannot detect swatch value of: " . $option_idx . '/' . $value_idx . " \n";
            continue;
        }

        $extension = strtolower(preg_replace('/^.+\.([^\.]+)$/', '', $value['swatch']));

        if (!in_array($extension, ['png', 'gif', 'jpg'], true)) {
            $extension = 'png';
        }

        try {
            $response = OSC::core('network')->curl($value['swatch'], ['browser']);

            if (!is_string($response['content'])) {
                throw new Exception('Response data is incorrect');
            }

            file_put_contents(OSC_VAR_PATH . '/crawler/' . $dirname . '/' . $option_idx . '.' . $value_idx . '.' . OSC::makeUniqid() . '.' . $value['value'] . '.' . $extension, $response['content']);
        } catch (Exception $ex) {
            echo "Error [" . $option_idx . '/' . $value_idx . "]: {$ex->getMessage()} \n";
            continue;
        }
    }
}

echo "DONE";
